import React, { useState } from "react";
import axios from "axios";
import { useNavigate, NavLink } from "react-router-dom";
import register from "../images/register.jpg";

export const CreateUser = () => {
  const navigate = useNavigate();

  const [createUser, setCreateUser] = useState({
    name: "",
    email: "",
    password: "",
  });

  const handleInputChange = (e) => {
    setCreateUser({ ...createUser, [e.target.name]: e.target.value });
  };

  const handleCreate = async (e) => {
    e.preventDefault();
    const token = localStorage.getItem("token");
    const name = createUser.name;
    const email = createUser.email;
    const password = createUser.password;

    try {
      const resp = await axios.post(
        "https://login-api.web2rise.in/api/create-user",
        {
          name: name,
          email: email,
          password: password,
        },
        {
          headers: {
            Authorization: token,
            "Content-Type": "application/json",
          },
        }
      );
      if (resp) {
        navigate("/User");
      }

      setCreateUser({
        name: "",
        email: "",
        password: "",
      });
      console.log(resp);
    } catch (error) {
      console.error(error);
    }
  };

  return (
    // <div>
    //     <form>
    //         <div className="input-box">
    //             <label>Name:</label>
    //             <input type="text" name='name' value={createUser.name} onChange={handleInputChange} placeholder="Enter your name" required />
    //         </div>
    //         <div className="input-box">
    //             <label>Email:</label>
    //             <input type="email" name='email' value={createUser.email} onChange={handleInputChange} placeholder="Enter your email" required />
    //         </div>
    //         <div className="input-box">
    //             <label>Password:</label>
    //             <input type="password" name='password' value={createUser.password} onChange={handleInputChange} placeholder="Enter your password" required />
    //         </div>
    //         <button type="submit" onClick={handleCreate}>Registration</button>
    //     </form>
    // </div>
    <>
      <section className="signup">
        <div className="container mt-5 box_sdow">
          <div className="signup-contant">
            <div className="signup-form">
              <h2 className="form-tittle">Sign Up</h2>
              <form action="" className="register-form" id="register-form">
                <div className="form-group">
                  <label className="lebal_border" htmlFor="name">
                    <i class="zmdi zmdi-account"></i>
                  </label>
                  <input
                    name="name"
                    value={createUser.name}
                    onChange={handleInputChange}
                    type="text"
                    autoComplete="off"
                    placeholder="Your Name"
                  />
                </div>

                <div className="form-group">
                  <label className="lebal_border" htmlFor="email">
                    <i class="zmdi zmdi-email"></i>
                  </label>
                  <input
                    name="email"
                    value={createUser.email}
                    onChange={handleInputChange}
                    type="text"
                    autoComplete="off"
                    placeholder="Your Email"
                  />
                </div>

                <div className="form-group">
                  <label className="lebal_border" htmlFor="password">
                    <i class="zmdi zmdi-lock"></i>
                  </label>
                  <input
                    value={createUser.password}
                    onChange={handleInputChange}
                    type="text"
                    name="password"
                    autoComplete="off"
                    placeholder="Your Password"
                  />
                </div>

                <div className="form-froup form-button">
                  <button
                    type="button"
                    onClick={handleCreate}
                    class="btn btn-success"
                  >
                    Registration
                  </button>
                </div>
              </form>
            </div>

            <div className="signup-image">
              <figure>
                <img
                  src={register}
                  className="img-fluid"
                  alt="registration pic"
                />
              </figure>
              <NavLink to="/User" className="signup-image-link">
                {" "}
                I Am Already Register{" "}
              </NavLink>
            </div>
          </div>
        </div>
      </section>
    </>
  );
};
